import { Box } from "@material-ui/core";

export default ({ state }) => (
  <Box p={2} height="500px" bgcolor="grey.300">
    {state ? (
      <Box>
        {state.results[0].name.first} {state.results[0].name.last}
      </Box>
    ) : (
      <Box>NO DATA SELECTED</Box>
    )}
  </Box>
);
